const EmailForm = () => {

    return (
        <form>
            <input type="text" name="to" readOnly />
            <input type="text" name="subject" />
            <textarea name="message" />
            <button>Cancel</button>
            <button>Send</button>
        </form>
    )
}

export default EmailForm;
